import React from 'react';

function SignIn() {
  return (
    <div className="2xl:w-[1090px] flex  justify-center bg-gray-100">
      <div className="container mx-auto max-w-2xl p-6 bg-white rounded-lg shadow-lg">
        <div className="md:flex">
          <div className="md:w-1/2">
            <img
              src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.svg"
              className="w-full h-auto"
              alt="Phone image"
            />
          </div>
          <div className="md:w-1/2 md:ml-6">
            <h2 className="text-3xl font-semibold mb-6">Sign In</h2>
            <div className="mb-4">
              <label htmlFor="email" className="block text-gray-700 font-medium mb-2">
                Email address
              </label>
              <input
                type="email"
                id="email"
                className="w-full px-4 py-2 border rounded-lg focus:outline-none focus:border-blue-500"
                placeholder="Enter your email"
              />
            </div>
            <div className="mb-4">
              <label htmlFor="password" className="block text-gray-700 font-medium mb-2">
                Password
              </label>
              <input
                type="password"
                id="password"
                className="w-full px-4 py-2 border rounded-lg focus:outline-none focus:border-blue-500"
                placeholder="Enter your password"
              />
            </div>
            <div className="mb-4 flex items-center justify-between">
              <label htmlFor="remember" className="flex items-center">
                <input
                  type="checkbox"
                  id="remember"
                  className="mr-2"
                />
                Remember me
              </label>
              <a href="!#" className="text-blue-500">Forgot password?</a>
            </div>
            <button className="bg-blue-500 text-white px-4 py-2 rounded-lg w-full">
              Sign in
            </button>
            <div className="my-4 text-center">
              <p className="text-gray-700 font-semibold">OR</p>
            </div>
            <button className="bg-facebook-blue text-white px-4 py-2 rounded-lg w-full mb-4">
              <i className="fab fa-facebook-f mr-2"></i>
              Continue with Facebook
            </button>
            <button className="bg-twitter-blue text-white px-4 py-2 rounded-lg w-full">
              <i className="fab fa-twitter mr-2"></i>
              Continue with Twitter
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SignIn;
